Property.Value:
BEGIN
	RETURN CAST( REPLACE( CAST( @Date AS VARCHAR(10) ), '-', '' ) AS INT );
END

CREATE FUNCTION dbo.CreateKeyFromDate
(
	@Date DATE
)
RETURNS INT
AS

BEGIN
	RETURN CAST( HASHBYTES( 'SHA2_512', @SourceID ) AS INT );
END

CREATE FUNCTION dbo.CreateKeyFromSourceID
(
	@SourceID VARCHAR(MAX)
)
RETURNS INT
AS

BEGIN
	RETURN CAST( HASHBYTES( 'SHA2_512', (
	SELECT 
		@IzvorniAgencija_ID AS IzvorniAgencija_ID,
		@NazivAgencije AS NazivAgencije,
		@SredisteAgencije AS SredisteAgencije,
		@AdresaAgencije AS AdresaAgencije,
		@TelefonAgencije AS TelefonAgencije,
		@EmailAgencije AS EmailAgencije
	FOR XML RAW('R'))) AS INT )
END

CREATE FUNCTION dbo.ufn_GetHashDimAgencija
(
	@IzvorniAgencija_ID INT,
	@NazivAgencije NVARCHAR (50),
	@SredisteAgencije NVARCHAR(50),
	@AdresaAgencije NVARCHAR(30),
	@TelefonAgencije CHAR(18),
	@EmailAgencije CHAR(20)
)
RETURNS VARCHAR(MAX)
AS

BEGIN
	RETURN CAST( HASHBYTES( 'SHA2_512', (
	SELECT 
		@IzvorniGrad_ID AS IzvorniGrad_ID,
		@NazivGrada AS NazivGrada,
		@NazivRegiona AS NazivRegiona
	FOR XML RAW('R'))) AS INT )
END

CREATE FUNCTION dbo.ufn_GetHashDimGrad
(
	@IzvorniGrad_ID INT,
	@NazivGrada NVARCHAR (50),
	@NazivRegiona NVARCHAR (30)
)
RETURNS VARCHAR(MAX)
AS

BEGIN
	RETURN CAST( HASHBYTES( 'SHA2_512', (
	SELECT 
		@IzvorniOdbor_ID AS IzvorniOdbor_ID,
		@Odbor AS Odbor,
		@Politicka_stranka AS Politicka_stranka,
		@Opstina AS Opstina
	FOR XML RAW('R'))) AS INT )
END

CREATE FUNCTION dbo.ufn_GetHashDimOdbor
(
	@IzvorniOdbor_ID INT,
	@Odbor NVARCHAR (50),
	@Politicka_stranka NVARCHAR (50),
	@Opstina NVARCHAR (50)
)
RETURNS VARCHAR(MAX)
AS

CREATE FUNCTION dbo.ufn_GetHashDimPrivrednaGrana
(
	@IzvorniPrivrednaGrana_ID INT,
	@Privredna_grana NVARCHAR (50)
)
RETURNS VARCHAR(MAX)
AS

BEGIN BEGIN TRANSACTION
MERGE dbo.DimAgencija AS TARGET USING ( SELECT dbo.CreateKeyFromSourceID(Agencija_ID) AS AgencijaKey, Agencija_ID AS IzvorniAgencija_ID, Naziv AS NazivAgencije, Srediste AS SredisteAgencije, Adresa AS AdresaAgencije, Telefon AS TelefonAgencije, Email AS EmailAgencije, dbo.ufn_GetHashDimAgencija( Agencija_ID, Naziv, Srediste, Adresa, Telefon, Email ) AS HashKey FROM [$(RDA)].[dbo].[Agencija] ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivAgencije = SOURCE.NazivAgencije ,TARGET.SredisteAgencije = SOURCE.SredisteAgencije ,TARGET.AdresaAgencije = SOURCE.AdresaAgencije ,TARGET.TelefonAgencije = SOURCE.TelefonAgencije ,TARGET.EmailAgencije = SOURCE.EmailAgencije WHEN NOT MATCHED BY TARGET THEN INSERT ( AgencijaKey ,IzvorniAgencija_ID ,NazivAgencije ,SredisteAgencije ,AdresaAgencije ,TelefonAgencije ,EmailAgencije ,HashKey ,Obrisan ) VALUES ( SOURCE.AgencijaKey ,SOURCE.IzvorniAgencija_ID ,SOURCE.NazivAgencije ,SOURCE.SredisteAgencije ,SOURCE.AdresaAgencije ,SOURCE.TelefonAgencije ,SOURCE.EmailAgencije ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = 1;
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE dbo.DimGrad AS TARGET USING ( SELECT dbo.CreateKeyFromSourceID(G.Grad_ID) AS GradKey ,G.Grad_ID AS IzvorniGradID ,G.Naziv AS NazivGrada ,R.Naziv AS NazivRegiona ,dbo.ufn_GetHashDimGrad( R.Region_ID ,R.Naziv ,G.Naziv ) AS HashKey FROM [$(RDA)].dbo.Grad AS G WITH (NOLOCK) INNER JOIN [$(RDA)].dbo.Region AS R WITH (NOLOCK) ON G.Region_ID=R.Region_ID ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivRegiona = SOURCE.NazivRegiona ,TARGET.NazivGrada = SOURCE.NazivGrada WHEN NOT MATCHED BY TARGET THEN INSERT ( GradKey ,IzvorniGrad_ID ,NazivGrada ,NazivRegiona ,HashKey ,Obrisan ) VALUES ( SOURCE.GradKey ,SOURCE.IzvorniGradID ,SOURCE.NazivGrada ,SOURCE.NazivRegiona ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = CAST( GETDATE() AS SMALLDATETIME );
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE dbo.DimKompanija AS TARGET USING ( SELECT dbo.CreateKeyFromSourceID(Kompanija_ID) AS KompanijaKey ,Kompanija_ID AS IzvorniKompanija_ID ,Naziv AS NazivKompanije ,Sifra AS SifraKompanije ,Sediste AS SedisteKompanije ,dbo.ufn_GetHashDimKompanija( Kompanija_ID ,Naziv ,Sifra ,Sediste ) AS HashKey FROM [$(RDA)].dbo.Kompanija ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivKompanije = SOURCE.NazivKompanije ,TARGET.SifraKompanije = SOURCE.SifraKompanije ,TARGET.SedisteKompanije = SOURCE.SedisteKompanije WHEN NOT MATCHED BY TARGET THEN INSERT ( KompanijaKey ,IzvorniKompanija_ID ,NazivKompanije ,SedisteKompanije ,SifraKompanije ,HashKey ,Obrisan ) VALUES ( SOURCE.KompanijaKey ,SOURCE.IzvorniKompanija_ID ,SOURCE.NazivKompanije ,SOURCE.SedisteKompanije ,SOURCE.SifraKompanije ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = CAST( GETDATE() AS SMALLDATETIME );
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE dbo.DimOdbor AS TARGET USING ( SELECT dbo.CreateKeyFromSourceID(O.Odbor_ID) AS OdborKey ,O.Odbor_ID AS IzvorniOdborID ,O.Naziv AS NazivOdbora ,PS.Naziv AS NazivPolitickeStranke ,PS.Opstina AS NazivOpstine ,dbo.ufn_GetHashDimOdbor( O.Odbor_ID ,O.Naziv ,PS.Naziv ,PS.Opstina ) AS HashKey FROM [$(RDA)].dbo.Politicka_stranka AS PS WITH (NOLOCK) INNER JOIN [$(RDA)].dbo.Odbor AS O WITH (NOLOCK) ON O.Politicka_stranka_ID=PS.Politicka_stranka_ID ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivOdbora = SOURCE.NazivOdbora ,TARGET.NazivPolitickeStranke = SOURCE.NazivPolitickeStranke ,TARGET.NazivOpstine = SOURCE.NazivOpstine WHEN NOT MATCHED BY TARGET THEN INSERT ( OdborKey ,IzvorniOdbor_ID ,NazivOdbora ,NazivPolitickeStranke ,NazivOpstine ,HashKey-->DONE ,Obrisan ) VALUES ( SOURCE.OdborKey ,SOURCE.IzvorniOdborID ,SOURCE.NazivOdbora ,SOURCE.NazivPolitickeStranke ,SOURCE.NazivOpstine ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = CAST( GETDATE() AS SMALLDATETIME );
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE dbo.DimPrivrednaGrana AS TARGET USING ( SELECT [dbo].[CreateKeyFromSourceID](pg.[Priv_Grana_ID]) AS PrivrednaGranaKey ,pg.[Priv_Grana_ID] AS IzvorniPrivrednaGranaID ,pg.[Naziv] AS NazivPrivredneGrane ,[dbo].[ufn_GetHashDimPrivrednaGrana]( pg.[Priv_Grana_ID] ,pg.[Naziv] ) AS HashKey FROM [$(RDA)].[dbo].[Privredna_grana] AS pg ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivPrivredneGrane = SOURCE.NazivPrivredneGrane WHEN NOT MATCHED BY TARGET THEN INSERT ( PrivrednaGranaKey ,IzvorniPrivrednaGrana_ID ,NazivPrivredneGrane ,HashKey ,Obrisan ) VALUES ( SOURCE.PrivrednaGranaKey ,SOURCE.IzvorniPrivrednaGranaID ,SOURCE.NazivPrivredneGrane ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = 1;
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE dbo.DimTVKanali AS TARGET USING ( SELECT [dbo].[CreateKeyFromSourceID](K.[Kanali_ID]) AS TVkanaliKey ,K.[Kanali_ID] AS IzvorniKanali_ID ,K.[Naziv] AS NazivKanala ,TV.[Naziv] AS TVkuca ,TV.[Sediste] AS SedisteTVkuca ,TV.[Adresa] AS AdresaTVkuca ,TV.[Email] AS EmailTVkuca ,TV.[Telefon] AS TelefonTVkuca ,SV.[Opis_strukture_vlasnistva] AS VrstaVlasnistva ,[dbo].[ufn_GetHashDimTVkanali]( K.[Kanali_ID] ,K.[Naziv] ,TV.[Naziv] ,TV.[Sediste] ,TV.[Adresa] ,TV.[Email] ,TV.[Telefon] ,SV.[Opis_strukture_vlasnistva] ) AS HashKey FROM [$(RDA)].[dbo].[Struktura_vlasnistva] AS SV WITH (NOLOCK) INNER JOIN [$(RDA)].[dbo].[TV_kuca] AS TV WITH (NOLOCK) ON TV.Struktura_vlasnistva_ID=SV.Struktura_vlasnistva_ID INNER JOIN[$(RDA)].[dbo].[Kanali] AS K WITH (NOLOCK) ON K.TV_kuca_ID=TV.TV_kuca_ID ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.NazivKanala = SOURCE.NazivKanala ,TARGET.TVkuca = SOURCE.TVkuca ,TARGET.SedisteTVkuca = SOURCE.SedisteTVkuca ,TARGET.AdresaTVkuca = SOURCE.AdresaTVkuca ,TARGET.EmailTVkuca = SOURCE.EmailTVkuca ,TARGET.TelefonTVkuca = SOURCE.TelefonTVkuca ,TARGET.VrstaVlasnistva = SOURCE.VrstaVlasnistva WHEN NOT MATCHED BY TARGET THEN INSERT ( TVkanaliKey ,IzvorniKanali_ID ,NazivKanala ,TVkuca ,SedisteTVkuca ,AdresaTVkuca ,EmailTVkuca ,TelefonTVkuca ,VrstaVlasnistva ,HashKey ,Obrisan ) VALUES ( SOURCE.TVkanaliKey ,SOURCE.IzvorniKanali_ID ,SOURCE.NazivKanala ,SOURCE.TVkuca ,SOURCE.SedisteTVkuca ,SOURCE.AdresaTVkuca ,SOURCE.EmailTVkuca ,SOURCE.TelefonTVkuca ,SOURCE.VrstaVlasnistva ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = 1;
IF @@ERROR <> 0 BEGIN ROLLBACK; END ELSE BEGIN COMMIT; END END

BEGIN BEGIN TRANSACTION
MERGE [dbo].[DimZaposleni] AS TARGET USING ( SELECT dbo.CreateKeyFromSourceID(Z.Zaposleni_ID) AS ZaposleniKey ,Z.Zaposleni_ID AS IzvorniZaposleni_ID ,Z.Ime AS ImeZaposlenog ,Z.Prezime AS PrezimeZaposlenog ,Z.JMBG AS JmbgZaposlenog ,Z.Email AS EmailZaposlenog ,PZ.Pozicija AS PozicijaZaposlenog ,dbo.ufn_GetHashDimZaposleni( Z.Zaposleni_ID ,Z.Ime ,Z.Prezime ,Z.JMBG ,Z.Email ,PZ.Pozicija ) AS HashKey FROM [$(RDA)].dbo.Zaposleni AS Z WITH (NOLOCK) INNER JOIN [$(RDA)].dbo.Pozicija_zaposlenog AS PZ WITH (NOLOCK) ON Z.Poz_zaposlenog_ID=PZ.Poz_zaposlenog_ID ) AS SOURCE ON ( TARGET.HashKey = SOURCE.HashKey ) WHEN MATCHED THEN UPDATE SET TARGET.ImeZaposlenog = SOURCE.ImeZaposlenog ,TARGET.PrezimeZaposlenog = SOURCE.PrezimeZaposlenog ,TARGET.JmbgZaposlenog = SOURCE.JmbgZaposlenog ,TARGET.EmailZaposlenog = SOURCE.EmailZaposlenog ,TARGET.PozicijaZaposlenog = SOURCE.PozicijaZaposlenog WHEN NOT MATCHED BY TARGET THEN INSERT( ZaposleniKey ,IzvorniZaposleni_ID ,ImeZaposlenog ,PrezimeZaposlenog ,JmbgZaposlenog ,EmailZaposlenog ,PozicijaZaposlenog ,HashKey ,Obrisan ) VALUES( SOURCE.ZaposleniKey ,SOURCE.IzvorniZaposleni_ID ,SOURCE.ImeZaposlenog ,SOURCE.PrezimeZaposlenog ,SOURCE.JmbgZaposlenog ,SOURCE.EmailZaposlenog ,SOURCE.PozicijaZaposlenog ,SOURCE.HashKey ,NULL ) WHEN NOT MATCHED BY SOURCE THEN UPDATE SET TARGET.Obrisan = CAST( GETDATE() AS SMALLDATETIME );
